response.about:
На рынке коммерческой фотографии с 2006 г. 
За это время сотрудничал со многими рекламными агентствами и журналами, украинскими и европейскими Dj's и музыкальными лейблами, украинскими и зарубежными музыкальными продюсерскими центрами, международными туристическими операторами и крупными украинскими холдингами.
Был одним из основателей фотопродакшена Glossy Studio. 
Опыт работы в рекламной фотографии за границей получил в Швейцарии, Доминиканской Республике, Египте, Иордании, Турции и России.
